#include "header.h"

class Solution {
public:
    int totalHammingDistance(vector<int>& nums) {
        int sum = 0;
        /*
         * for (int i = 0; i < nums.size(); i++) {
         *     for (int j = i + 1; j < nums.size(); j++) {
         *         int hamming = nums[i] ^ nums[j];
         *         while (hamming > 0) {
         *             sum += (hamming & 1);
         *             hamming = hamming >> 1;
         *         }
         *     }
         * }
         * */

        for (int j = 0; j < 64; j++) {
            int count1 = 0;
            for (int i = 0; i < nums.size(); i++) {
                count1 += (nums[i] & 1);
                nums[i] = (nums[i] >> 1);
            }
            sum += count1 * (nums.size() - count1);
        }
        return sum;
    }
};


